						<h2>Rotate right</h2><div style='width: 300px; height: 300px; -webkit-transform: rotate(90deg); -moz-transform: rotate(90deg); -o-transform: rotate(90deg); -ms-transform: rotate(90deg); transform: rotate(90deg);'><img width='300' height='200' alt='full' src='data:image/jpeg;base64,'></div>
						<h2>Small stretched</h2><div><img width='800' height='200' alt='xxx' src='data:image/jpeg;base64,'></div>
						<h2>Normal size</h2><div style='width: 100%'><img alt='xxx' src='data:image/jpeg;base64,'></div>
						<div style='page-break-after:always'></div>";
		}

